  type Data = {
    segmentedControl: string;
  };
  const defaultValues: Data = {
    segmentedControl: 'ベジータ'
  };
  const {
    control,
    handleSubmit,
    watch,
    formState: {
      errors
    }
  } = useForm<Data>({
    defaultValues
  });
  const onSubmit: SubmitHandler<Data> = data => console.log('submit:', data);
  console.log('watch:', watch());
